import React, { useState } from 'react';
import axios from 'axios';

const TransactionForm = ({ onTransactionAdded }) => { // Added onTransactionAdded prop
  const [type, setType] = useState('income');
  const [category, setCategory] = useState('');
  const [amount, setAmount] = useState('');
  const [date, setDate] = useState(new Date().toISOString().split('T')[0]);
  const [description, setDescription] = useState(''); // Changed from notes to description
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const config = {
        headers: {
          'x-auth-token': token, // Updated header
        },
      };
      await axios.post('http://localhost:5000/api/transactions', {
        type,
        category,
        amount: parseFloat(amount),
        date,
        description, // Changed from notes to description
      }, config); // Pass config here

      // Clear form
      setType('income');
      setCategory('');
      setAmount('');
      setDate(new Date().toISOString().split('T')[0]);
      setDescription('');
      setError('');

      if (onTransactionAdded) {
        onTransactionAdded(); // Call callback to refresh list
      }
    } catch (err) {
      setError(err.response?.data?.msg || 'Failed to add transaction');
    }
  };

  return (
    <div> {/* Removed extra div */}
      <h2 className="text-2xl font-bold mb-6 text-gray-800">Add Transaction</h2>
      {error && <div className="bg-red-100 text-red-600 p-3 rounded mb-4">{error}</div>}

      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Type</label>
          <select
            value={type}
            onChange={(e) => setType(e.target.value)}
            className="w-full p-2 border rounded text-gray-700"
          >
            <option value="income">Income</option>
            <option value="expense">Expense</option>
          </select>
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Category</label>
          <input
            type="text"
            value={category}
            onChange={(e) => setCategory(e.target.value)}
            className="w-full p-2 border rounded text-gray-700"
            required
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Amount</label>
          <input
            type="number"
            value={amount}
            onChange={(e) => setAmount(e.target.value)}
            className="w-full p-2 border rounded text-gray-700"
            required
            min="0"
            step="0.01"
          />
        </div>

        <div className="mb-4">
          <label className="block text-gray-700 mb-2">Date</label>
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="w-full p-2 border rounded text-gray-700"
            required
          />
        </div>

        <div className="mb-6">
          <label className="block text-gray-700 mb-2">Description</label> {/* Changed from Notes to Description */}
          <textarea
            value={description} // Changed from notes to description
            onChange={(e) => setDescription(e.target.value)} // Changed from setNotes to setDescription
            className="w-full p-2 border rounded text-gray-700"
            rows="3"
          />
        </div>

        <div className="flex space-x-4">
          <button
            type="submit"
            className="flex-1 bg-blue-500 text-white p-2 rounded hover:bg-blue-600"
          >
            Add Transaction
          </button>
          {/* Removed Cancel button as it's now part of a page */}
        </div>
      </form>
    </div>
  );
};

export default TransactionForm;
